B.DJ=A.a(s(['Das Palais Coburg mag zuerst Assoziationen zur Johann Strauss wecken, der ja 1886 ein B\xfcrger von Coburg Sachsen wurde. Und tats\xe4chlich, zwischen Constanze Geiger und Johann Strauss bestand eine wertsch\xe4tzende Beziehung, belegt durch eine originelle Widmung. Und zwar so: Constanze Geiger, die mit 18 Jahren den kaiserlichen Verm\xe4hlungsmarsch f\xfcr Kaiserin Elisabeth komponierte, heiratete am 23. April 1862 den Prinzen Leopold von Sachsen-Coburg und Gotha und wurde mit dieser morganatischen Ehe \u2013 das hei\xdft, sie entsprach nicht dem gesellschaftlichen Stand des Mannes \u2013 in den Freifrauenstand erhoben. Mit der Hochzeit zog sie sich \u2013 wie es f\xfcr Frauen gesellschaftlich zu gelten hatte \u2013 von der B\xfchne g\xe4nzlich zur\xfcck und lebte mit ihrer Familie auf Schloss Radmeric im heutigen Tschechien. Ihre Kompositionen f\xfcr Kammer- und Kirchenmusik wurden aber weiterhin aufgef\xfchrt. Nach dem Tod ihres Mannes zog sie nach Paris. Dort starb sie; Constanze Geiger wurde auf dem Friedhof Montmartre beerdigt. Drei Monate nach der Geburt von Constanzes Sohn Franz im Jahr 1860 f\xfchrte Johann Strauss seinen Prinz Leopold gewidmeten \u201eGrillenbanner" - Walzer op. 247 auf, dessen Titel keineswegs auf die singenden Insekten anspielt, sondern auf den \xc4rger im Haus Coburg wegen der morganatischen Ehe Bezug nimmt. \u201eGrille" ist n\xe4mlich ein anderer Ausdruck f\xfcr \u201eLaune, verr\xfcckte Idee".','Josefine Pepi Fr\xf6hlich, geboren 1803 auf der Wieden, gestorben 1878 in Wien, war S\xe4ngerin, Gesangslehrerin und Komponistin. Sie war eine von f\xfcnf Komponistinnen, die 1854 f\xfcr Kaiserin Elisabeths Huldigungskassette beauftragt wurden, eine "Huldigung der Tonsetzer Wiens", dem Hochzeitsgeschenk f\xfcr das Kaiserpaar. Sie beteiligte sich mit dem Werk \u201eErinnerung", der Vertonung eines Grillparzer-Textes, der ihr Mitbewohner in der Spiegelgasse 1 war. Die vier Fr\xf6hlich - Schwestern Anna, Barbara, Katharina und Josefine wuchsen in einem gutb\xfcrgerlichen, von Musik gepr\xe4gten Umfeld auf und erhielten vermutlich schon als Kinder Unterricht im Klavierspiel und Gesang. Josefine Fr\xf6hlich wurde in den Jahren 1819 bis 1821 von ihrer zehn Jahre \xe4lteren Schwester Anna an der Singschule der Gesellschaft der Musikfreunde unterrichtet. Sp\xe4ter wurde sie vom italienischen S\xe4nger Giuseppe Siboni ausgebildet. Am 12. Juni 1821 deb\xfctierte sie als "Constanze" in Mozarts \u201eEntf\xfchrung aus dem Serail" am K\xe4rntnertortheater. In Kopenhagen und Schweden, an Opernh\xe4usern in Dresden, Prag, Venedig und Mailand wurde sie gefeiert. Die k\xfcnstlerisch begabten jungen Frauen bildeten einen Mittelpunkt im b\xfcrgerlichen Wiener Kulturleben und pr\xe4gten es entscheidend mit. Zu ihren Bekannten z\xe4hlten Franz Grillparzer, Franz Schubert, die Familien Sonnleithner und Kiesewetter. Ab den 1860er Jahren waren sie mit Marie von Ebner-Eschenbach befreundet. Sowohl Schubert als auch Grillparzer schufen Werke f\xfcr Josefine Fr\xf6hlich. Bereits ab 1815 schien Josefine Fr\xf6hlich im Mitglieder-Verzeichnis der Gesellschaft der Musikfreunde als aus\xfcbendes Mitglied auf. Ungef\xe4hr ab diesem Zeitpunkt trat sie gemeinsam mit ihren Schwestern Anna und Barbara bei den musikalischen Abenden der Familie Sonnleithner auf. Joseph Sonnleithner war jener Sekret\xe4r, der im Namen der Fanny von Arnstein die Gr\xfcndung des Wiener Musikvereins vollzog. Bei Veranstaltungen im privaten bzw. halb\xf6ffentlichen Bereich trug Josefine Fr\xf6hlich auch nach ihrer internationalen Karriere Lieder vor. Sie lebte mit ihren Schwestern in der Spiegelgasse 21, mit Franz Grillparzer im gemeinsamen Haushalt. Josefine Fr\xf6hlich wurde am Hietzinger Friedhof bestattet.','Gesellschaft der Musikfreunde Konservatorium. Im Jahr 1880 hat Gisela Frankl \u2013 Pianistin und Komponistin \u2013 hier studiert. 1881 widmete sie Kronprinz Rudolf anl\xe4sslich dessen Verm\xe4hlung mit Stephanie von Belgien die Komposition \u201eHochzeits-Hymne", die in Anwesenheit des Kronprinzen uraufgef\xfchrt wurde. Gisela Frankl, 1860 in Wien geboren, war die Tochter eines Hof- und Gerichtsadvokaten. Sie verbrachte ihre ersten Lebensjahre in der Leopoldstadt, ehe die Familie Ende der 1860er Jahre zun\xe4chst nach Oberd\xf6bling und danach in die Innere Stadt \xfcbersiedelte. Gisela Frankl z\xe4hlte zu den ersten Sch\xfclerinnen der vierklassigen "H\xf6heren Bildungsschule f\xfcr M\xe4dchen", die 1871 vom Wiener Frauen-Erwerb-Verein gegr\xfcndet worden war. Zus\xe4tzlich erhielt sie Privatunterricht in Franz\xf6sisch und Englisch. Ab dem achten Lebensjahr erhielt sie Klavierunterricht, unter anderem bei Josef Dachs, dem sie sp\xe4ter ihr Werk \u201eMazurka de Salon" op. 25 widmen sollte. Im Studienjahr 1873/1874 wurde sie am  Konservatorium der Gesellschaft der Muskfreunde in Wien als Sch\xfclerin der \u201eVorbildungsschule" im Fach Klavier gef\xfchrt. Anschlie\xdfend wechselte sie an die \u201eClavierschule Ungar", wo sie beim Direktor des Instituts, Prof. Ungar, Klavier studierte, sich auch in Kontrapunkt und Komposition ausbildete. 1880 legte sie die Staatspr\xfcfung als \u201e\xf6ffentliche Lehrerin f\xfcr Clavier und Harmonielehre" mit Auszeichnung ab und gr\xfcndete selbst ein Musikinstitut. Um das Jahr 1892 unternahm Gisela Frankl \u2013 vermutlich gemeinsam mit ihrer Schwester, der Malerin Regine Frankl \u2013 eine Tournee in Nordamerika. Ihre Werke erschienen in Folge regelm\xe4\xdfig in Druck, 1890 waren rund 50 ihrer Kompositionen bei verschiedenen Verlegern erschienen.',"Hier befand sich der Wohnort und das B\xfcro der Musikproduktionst\xe4tigkeit von Josephine Weinlich. Josephine Weinlich-Amann, geboren 1848, war Pianistin, Violinistin, Komponistin und Dirigentin. Sie gr\xfcndete in Wien Ende der 1860er Jahre das erste europ\xe4ische Damenorchester, das bis 1879 als \u201eWeinlichsches Damenorchester\u201c oder als \u201eWiener Damencapelle\u201c bekannt war. Wien erinnert sich an die Komponistin, Dirigentin, Geigerin und Orchestergr\xfcnderin. Seit 2018 gibt es in Floridsdorf die Weinlich-Amann-Gasse.","Der Gasthof zum Goldenen Lamm war Treffpunkt f\xfcr Politiker und K\xfcnstler:innen. Im Goldenen Lamm wohnte w\xe4hrend seiner Wiener Aufenthalte der tschechische Komponist Anton\xedn Dvo\u0159\xe1k \u2013 was eine Tafel auf der Stra\xdfenseite auch vermerkt. Nicht vermerkt ist: Hier lernten sich die Pianistin und Komponistin Constanze Geiger und Prinz Leopold von Sachsen-Coburg kennen. Geiger war eine von f\xfcnf Komponistinnen, die f\xfcr das Kaiserin Elisabeth Huldigungsalbum komponierten. Das Geb\xe4ude des Goldenen Lamms wurde 1760 errichtet, 1823 durch B\xfcrgermeister Josef Klee aufgestockt und erhielt sp\xe4ter eine fr\xfchhistoristische Fassade. Als sich der Besitzer entschloss, von seinem Gasthof aus Stellwagen zu betreiben, die nach Brunn am Gebirge, M\xf6dling, Eisenstadt und Hainburg abgingen, erlebte dieser Gasthof eine Bl\xfctezeit. Weltweit waren Verkehrsknotenpunkte auch Zentren der Unterhaltungsmusik. Der Erfolg veranlasste auch andere Gasth\xf6fe Stellfuhrunternehmungen ins Leben zu rufen.",'Um die Mitte des 19. Jahrhunderts entstand auf der Landstra\xdfer Hauptstra\xdfe aus zwei kleinen Gasth\xe4usern, die der Brauereibesitzer Anton Dreher senior gekauft hatte, ein vornehm ausgestattetes Gasthauslokal mit gro\xdfem Gastgarten: \u201eDrehers Etablissement". Er\xf6ffnet am 25. Dezember 1859, war es eines der gr\xf6\xdften Gastlokale Wiens. Wie \xfcblich im 19. Jahrhundert, noch bevor der Gr\xfcndung der gro\xdfen Konzertinstitutionen, gab es einen Konzert- und Tanzsaal. Hier fanden zum Beispiel die Liedertafel des Arbeiter-S\xe4ngerbundes statt oder Arbeiter-B\xe4lle. Auch \u201egro\xdfe Politik" wurde in \u201eDrehers Etablissement" gemacht: Friedrich Adler und Otto Bauer waren unter den Rednern. Nach dem Zweiten Weltkrieg wurde der Gastst\xe4ttenbetrieb einer kompletten Erneuerung unterzogen und unter dem Namen \u201eSchwechaterhof" weitergef\xfchrt. Ende der achtziger Jahre wurde der Schwechater Hof zur Galleria. Genau hier schreibt Josephine Weinlich Musikgeschichte. Sie gr\xfcndet das erste europ\xe4ische Frauenorchester und tritt mit ihren Kolleginnen in der Bierhalle von Anton Dreher auf. Seit 2018 gibt es in Floridsdorf die Weinlich-Amann-Gasse benannt nach  Josephine Amann-Weinlich, Dirigentin, Musikerin, Komponistin. Sie geh\xf6rte zu den ersten berufsm\xe4\xdfigen Geigerinnen und gr\xfcndete 1868 in Wien das erste nur aus Frauen bestehende Ensemble.','1873 spielte das Josephine Weinlich Orchester w\xe4hrend der Wiener Weltausstellung in den Blumens\xe4len der k. k. Gartenbaugesellschaft. Der Vater hatte ihr die Musik-Agentur T\xe4tigkeit in die Wiege gelegt. Dem \u201eIllustrierten Wiener Extrablatt\u201c zufolge hatte der beg\xfcterte Industrielle Franz Weinlich im Zuge der Revolution 1848 sein Verm\xf6gen verloren und sich daraufhin eine \u201eKonzession zur Leitung einer Volkss\xe4nger-Gesellschaft\u201c sowie \u201eseinen T\xf6chtern eine Lizenz zum \u201aAuftreten\u2018\u201c verschafft. Erst gr\xfcndete Josephine Weinlich ein Damenquartett, dann konnte das erste Frauenorchester Europas gebildet werden. Als \u201eWeinlichsches Damenorchester" \u201eWiener Damencapelle" oder \u201eWiener Damenorchester" unternahm es Tourneen durch \xd6sterreich-Ungarn, Italien und Deutschland bis Nordamerika und Russl\xf6and. Das Repertoire umfasste zeitgen\xf6ssische Unterhaltungsmusik wie Tanzkompositionen, Ouvert\xfcren und Opernst\xfccke. Josefine Weinlich leitete wie die Strauss-Br\xfcder das Orchester zun\xe4chst von der Violine und komponierte auch selbst.'," 23. April 1854, ein sch\xf6ner Fr\xfchlingstag um die Mittagszeit. S\xe4mtliche H\xe4user, das ganze Ufer der Donau ist an jenem Tag mit Menschen ges\xe4umt. So dicht, dass kein Verkehr mehr m\xf6glich war. Anlass war die Ankunft der zuk\xfcnftigen Kaiserin Sisi, der Braut von Franz Joseph, die mit dem Schiff aus Bayern anreiste und nun endlich Wien erreichte. Ganz Nu\xdfdorf war aus dem H\xe4uschen, Gro\xdf und Klein war auf den Beinen, ganz nach dem Motto: \u201cGemma Kaiserbraut schau\u2019n.\u201d B\xf6llersch\xfcsse k\xfcndigen das Schiff mit der herannahenden Teenager-Braut an. Musik geh\xf6rt dazu. Unter den Kompositionen, die zur allerh\xf6chsten Ankunft in Auftrag gegeben wurden, war auch Constanze Geigers kaiserlicher Verm\xe4hlungsmarsch, gewidmet Kaiserin Elisabeth. Constanze Geiger war ein Kinderstar und Wunderkind, Pianistin, Theaterschauspielerin, Komponistin und S\xe4ngerin. Die Wienerin Geiger, geboren 1835, war die Tochter des Komponisten Joseph Geiger und der Hofmodistin Theresia Geiger; sie lernte Klavier bei Johann Wenzel Tomaschek und Simon Sechter, trat bereits mit 6 Jahren erfolgreich als Konzertpianistin auf und absolvierte Gastspiele in ganz Europa. Mit 18 Jahren komponierte sie den \u201eElisabethen-Verm\xe4hlungsmarsch\u201c, der erstmals erklang am 21. April 1854 bei der Ankunft von Herzogin Elisabeth in Bayern."]),t.s)
B.DK=A.a(s(['Als im Februar 1928 Josephine Baker im Wiener Theater Ronacher auftreten sollte, kam es im Parlament zu einer mehrst\xfcndigen Debatte. Der christlich-soziale Abgeordnete Anton Jerzabek hielt eine von theatralischen Zwischenrufen und von Gel\xe4chter unterbrochene Brandrede gegen Josephine Baker, erregte sich \xfcber ihre Kunst, \xfcber ihr Federn- und Perlenkost\xfcm und verglich sie mit "einer Wilden aus dem Kongo".',"Strohkoffer, heute der Keller unter der American Loos Bar: Alfred Schmeller, der Kunsthistoriker, fand f\xfcr den Artclub ein neues Lokal im K\xe4rntnerdurchgang, den Keller unter der American Bar, die Alfred Loos im Jahre 1908 entworfen hatte. Dieser K\xfcnstlerInnen-Treffpunkt, der seinen Namen nach den mit Strohmatten ausgelegten W\xe4nden hatte, bestand von 1951 bis 1953. Als 1952 das \u201ePorgy and Bess-Ensemble\u201c in Wien gastierte \u2013 bekanntlich hatte George Gershwin seine Oper f\xfcr black singers reserviert \u2013 war der Strohkoffer das einzige Lokal in Wien, wo die G\xe4ste willkommen waren \u2013 darunter Leontyne Price und Cab Calloway.","Als die Zeitungen vom \u201eN...skandal\u201c sprachen, die katholische Kirche Sondergottesdienste zur Bu\xdfe gegen Bakers \u201eschwere Verst\xf6\xdfe gegen die Moral\u201c organisierte und die Nationalsozialistische Deutsche Arbeiterpartei (NSDAP) Wiens gegen die \u201eobsz\xf6nen\u201c Auftritte protestierte, entzogen die Beh\xf6rden dem Ronacher-Theater 1928 die Bewilligung f\xfcr die Show. Erst 1932 durfte Baker im Ronacher ein gefeiertes Gastspiel geben, danach erst wieder 1958.","Im Ringstra\xdfen Hotel Bristol und im nahe gelegenen Ana Grand Hotel wohnte Josephine Baker mehrmals bei ihren Wien-Besuchen seit den 1920er Jahren. Von diesen Aufenthalten sind die Meldezettel \xfcberliefert mit ihrer eigenh\xe4ndigen Unterschrift. Die Bristol Hotels in ganz Europa nennen mittlerweile eine ihrer Suiten nach Josephine Baker.",'Josephine Baker trat 1928 in der Revue \u201eSchwarz auf Wei\xdf" im Johann Strau\xdf-Theater auf. Nach 1945 hie\xdf das Etablissement Scala-Theater. 1959 wurde das Theater, das \xfcber 1.000 Personen fasste, abgerissen.']),t.s)
